onomo"], "83": ["Качество и цена  полное несоответствие. Ддаже 299 руб  за  этот товар- это  слишком!!!", "2020-12-07T15:51:15Z", "прозрачный", "0", 3, 0, 2, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "84": ["С этой ерундой ещё больше проблем с хранением ", "2020-12-07T10:27:47Z", "прозрачный", "0", 3, 0, 1, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "85": ["Ерунда полная", "2020-12-06T21:00:29Z", "прозрачный", "0", 3, 0, 2, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "86": ["Прекрасно все подошло под футболки", "2020-12-05T09:33:34Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "87": ["Товар в принципе устраивает. Тонкий пластик, но для детских футболок подходит. Минус за доставку: был без упаковки и выпачкан во что-то жирное. Решила оставить и не перезаказывать, так как может придти помятый.", "2020-12-02T20:37:19Z", "прозрачный", "0", 3, 0, 4, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "89": ["Это просто жесткая плёнка, по типу той, в которую упаковывают флешки и проч. Вернула.", "2020-12-02T07:03:48Z", "прозрачный", "0", 3, 1, 1, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "90": ["Удобно, красиво", "2020-12-01T18:30:49Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "91": ["Просто не понравился. Заказала попробовать, ожидала другого.", "2020-11-30T10:53:48Z", "прозрачный", "0", 1, 0, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "92": ["очень, удобно... качество хорошее", "2020-11-29T03:28:11Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "93": ["Не стоит этих денег. Качество пластика так себе, имеет смысл использовать для футболок от 50 размера.", "2020-11-27T06:11:44Z", "прозрачный", "0", 1, 0, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "94": ["Качество не понравилось ", "2020-11-26T06:40:50Z", "прозрачный", "0", 1, 0, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "95": ["Уважаемые производители и продавцы! Почему  в аннотации написано 10 штук? в действительности их 8!", "2020-11-23T09:33:25Z", "прозрачный", "0", 3, 0, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "96": ["Дааа, думала будет нормальный пластик, а это просто фигня какая то. Буду искать более прочные органайзеры.", "2020-11-22T10:53:24Z", "прозрачный", "0", 12, 0, 2, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "98": ["Пришёл уже рваный, отказ. Но даже если бы пришёл без брака, не взяла бы, так как очень тонкий пластик и не выдержит ежедневного прикосновения.", "2020-11-15T07:48:55Z", "прозрачный", "0", 1, 0, 1, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "99": ["Задумка отличная, но исполнение... листы очень тонкие, при первой сборке уже половина из них порвались)) ", "2020-11-07T13:09:46Z", "прозрачный", "0", 3, 0, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "100": ["Взяла 3 упаковки. Брака и недостача листов нет, все отлично, получилась такая вот стопочка из 30 футболок. Буду заказывать ещё. Для того, чтобы вещи не разьезжались и ровно лежали - необходимо каждую футболку предварительно отгладить и аккуратно сложить и тогда стопочка будет прям как из магазина. ", "2020-11-06T13:42:47Z", "прозрачный", "0", 25, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "101": ["Цена качество соответсвует.Не пластик.Для футболок подойдёт.", "2020-11-04T20:58:46Z", "прозрачный", "0", 2, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "102": ["Очень тонкие пластины, как бумага", "2020-11-03T21:18:32Z", "прозрачный", "0", 1, 0, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "103": ["Качество ужасное, хрустящая ломкая пленка, а не пластик, ну и сама конструкция такова, что пользоваться неудобно. Не рекоме