фектом, на функционал не влияет, поэтому оставила. Ну лежат в стопочке вещи, аккуратненько, но можно и без них. Ещё раз вряд ли возьму, но идея неплохая.", "2020-08-29T15:29:32Z", "прозрачный", "0", 4, 1, 3, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "172": ["Более бесполезной вещи я еще не встречала. Просто ни о чём.", "2020-08-28T19:56:21Z", "прозрачный", "0", 2, 1, 1, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "174": ["Пришёл не тот товар!!!!", "2020-08-28T07:08:37Z", "прозрачный", "0", 0, 2, 2, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "176": ["классная штука. Долго искала способ хранения многочисленных футболок. Пластик мягкий. Может даже хрупкий. Легко сгибается, если \"листать\" в поиске нужной вещи. \r\nЗа два месяца использования ни один \"лист\" не сломался. Буду брать еще.", "2020-08-23T19:54:22Z", "прозрачный", "0", 6, 0, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "177": ["Спасибо, всё супер", "2020-08-23T12:02:22Z", "прозрачный", "0", 1, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "178": ["Очень удобная вещь, помощница идеально наводит порядок в шкафу)))", "2020-08-22T05:49:37Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "179": ["Честно говоря, ожидала большего. Не очень удобно складывать, поскольку сами пластинки слишком широкие, и объем от вещи мешает им складываться друг на друга.... Впрочем, если приноровиться, то хорошая вещь. В шкафу стало меньше беспорядка", "2020-08-22T05:18:30Z", "прозрачный", "0", 2, 1, 4, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "180": ["Чтобы все аккуратно лежало , к этому органайзеру нужна рамка для складывания одежды.", "2020-08-20T06:56:53Z", "прозрачный", "0", 5, 0, 4, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "181": ["Органайзер удобный, лёгкий. Спасибо производителю и WB. ", "2020-08-19T18:57:18Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "182": ["Психанула. Не удобная и большая", "2020-08-19T11:29:17Z", "прозрачный", "0", 1, 0, 1, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "183": ["Удобный органайзер,занимает мало места.", "2020-08-16T13:38:19Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "184": ["Товар оценить не могу. Заказываю ради эксперимента второй раз (в первый раз разорвали упаковку, не посмотрев). Второй раз привозят разделители Ezstax. Которые дешевле рублей на 30. Это новый способ обмана??? ", "2020-08-15T16:26:22Z", "прозрачный", "0", 2, 7, 1, "Органайзер для одежды, хранения футболок - 10 штук", "Ronomo"], "185": ["Удобная  вещь. Хорошо упакована.", "2020-08-11T16:12:18Z", "прозрачный", "0", 0, 1, 5, "Органайзер для одежды", "Ronomo"], "187": ["Хорошее решение для порядка в шкафу. Рекомендую 👍", "2020-08-10T19:02:53Z", "прозрачный", "0", 1, 1, 5, "Органайзер для одежды", "Ronomo"], "188": ["Отличный органайзер! Наконец будет порядок в шкафу! Буду ещё заказывать. Рекомендую к приобретению. Спасибо магазину , все доставлено быстро и в идеальном состоянии. Пластик не толстый, но это и естественно, для хранения толще и нет необходимости. А ещё удобно в чемодан вещи складывать, не так мнутся. Очень нравится)))👍", "2020-07-31T04:52:00.686584773Z", "прозрачный", "0", 8, 1, 5, "Органайзер для одежды", "Ronomo"], "190": ["Тонкий пластик, без крепления, но для футболок отлично и занимает меньше в объёме и всегда аккуратно в шкафу. Заказала 2 упаковки, все пригодились)", "2020-08-09T20:35:34Z", "прозрачный", "0", 3, 1, 5, "Органайзер для одежды", "Ronomo"], "191": ["Листы никак не скрепляются. Больше не куплю ", "2020-08-07T18:49:23Z", "прозрачный", "0", 7, 1, 2, "Органайзер для одежды", "Ronomo"], "192": ["Цена качество не соответствует. Идея хорошая, но листы даже не скрепляются никак между собой. Так можно картон наложить и функционал тот же будет. Не советую", "2020-08-06T19:53:46Z", "прозрачный", "0", 6, 1, 3, "Органайзер для одежды", "Ronomo"], "193": ["Если честно, задумка неплохая , а по факту хлипенький пластик...", "2020-07-30T06:09:44.337405269Z", "прозрачный", "0", 7, 1, 2, "Органайзер для одежды", "Ronomo"], "194": ["Аккуратно разложил футболки, все попорядку👍Удобно, практично🤩", "2020-07-28T09:58:24.6389271Z", "прозрачный", "0", 20, 1, 5, "Органайзер для одежды", "Ronomo"], "195": ["Очень тоненький пластик. Сильно гнётся . Плюс в размерах.Полагала будет жёстче. Размер хороший.", "2020-07-27T11:11:45.994526014Z", "прозрачный", "0", 5, 0, 2, "Органайзер для одежды", "Ronomo"], "196": ["Пришли целые и ровно 10 штук. Пластик да, тонкий, но пластичный, при нормальном использовании ломпться не будет) по размеру оказались больше, чем ожидала) заказывала для топов, но т.к пластины большие, буду хранить по 2-3 топа на одной. Для глубоких шкафов- это спасение)", "2020-07-25T15:39:05.666802206Z", "прозрачный", "0", 14, 0, 5, "Органайзер для одежды", "Ronomo"], "197": ["Нормальные органайзеры.В основном для футболок,т.к.тонкие листы.Но для эксперимента сложила на них трикотажные штаны и трикотажный лонгслив.Пришли 10 шт.,но совершенно без какой -либо упаковки.Мне повезло,все листы целые.Брала за 349 руб.Спасибо  WB  и поставщику.", "2020-07-22T16:42:44.769147973Z", "прозрачный", "0", 9, 1, 5, "Органайзер для одежды", "Ronomo"], "198": ["Очень понравился органайзер. Пришло всё целое. Попробовала переложить им всё что было в шкафу — домашняя одежда, летняя нормально, для совсем толстой одежды не подойдёт. Заказала ещё один.", "2020-07-19T20:50:13.399410017Z", "прозрачный", "0", 5, 0, 5, "Органайзер для одежды", "Ronomo"], "199": ["Не знаю, почему у народа негативные отзывы. Абсолютно функциональная вещь. Да, пластик тонкий, но  и легкий, соответственно, все футболочки лежат и не мнуться, аккуратно и организованно,  ане придавлены толстыми тяжелыми листами. Мне понравился органайзер очень.", "2020-07-16T09:32:17.603608871Z", "прозрачный", "0", 15, 0, 5, "Органайзер для одежды", "Ronomo"], "200": ["Хорошая удобная  вещь, купила 5 шт. Но одна упаковка пришла мятая. Поэтому 4 балла.", "2020-07-15T16:42:18.428712561Z", "прозрачный", "0", 3, 0, 4, "Органайзер для одежды", "Ronomo"], "201": ["Прочитала отзывы, по которым стало понятно, что не всем повезло, но идея очень понравилась, долго не могла найти решение для организации хранения в новом и неудобном шкафу ( вместо старого удобного комода), решила рискнуть, заказала 6 штук. Результат очень обрадовал- все 6 пришли в идеальном состоянии, упакованы в 3-4 слоя, очень крепко, все в полной комплектации и без повреждений. Может мне повезло, но думаю, что производитель или поставщик приняли во внимание указанные недостатки и теперь  за всем следят. Мне органайзер понравился, ощутимое удобство и организация порядка.", "2020-07-15T12:42:42.347377891Z", "прозрачный", "0", 7, 1, 5, "Органайзер для одежды", "Ronomo"], "202": ["Мне понравился органайзер. Футболки и летняя одежда лежат в шкафу очень аккуратно. И доставать легко и видно все. Рекомендую", "2020-07-15T10:56:58.355189087Z", "прозрачный", "0", 6, 0, 5, "Органайзер для одежды", "Ronomo"], "203": ["А мне понравились эти штуки, в качестве разделителей в стопке футболок - вполне, ну да, тонковаты, но не совсем уж.", "2020-07-13T23:54:41.56446467Z", "прозрачный", "0", 3, 0, 5, "Органайзер для одежды", "Ronomo"], "204": ["Замечательный органайзер за свою цену", "2020-07-13T19:17:32.173072004Z", "прозрачный", "0", 3, 0, 5, "Органайзер для одежды", "Ronomo"], "205": ["Пришло все целое, но Пластик , если это можно так назвать, очень тонкий, ожидала всё-таки поплотнее. Но в принципе для футболок думаю сойдёт, посмотрим в деле", "2020-07-12T14:39:36.029931128Z", "прозрачный", "0", 3, 0, 4, "Органайзер для одежды", "Ronomo"], "206": ["Не впечатлил, место не экономит", "2020-07-11T20:48:52.51837988Z", "прозрачный", "0", 2, 0, 3, "Органайзер для одежды", "Ronomo"], "207": ["Из заявленных 10-ти файлов в упаковке в реальности оказалось всего 7 штук. ... Это обнаружилось дома, когда я вскрыла упаковку.... Остался неприятный осадок.... Будьте внимательны, проверяйте наличие файлов ав пункте евыдачи", "2020-07-08T21:06:26.319331569Z", "прозрачный", "0", 6, 0, 5, "Органайзер для одежды", "Ronomo"], "208": ["Пришёл с деформацией", "2020-07-06T13:02:25.100593807Z", "прозрачный", "0", 3, 4, 3, "Органайзер для одежды", "Ronomo"], "209": ["Удобно не только для футболок, но и для джемперов. - 1звезда, за то, что несколько штук приехали уже с трещиной. Брала в качестве эксперемента, чкть больше чем за 300 руб. Хорошая вещь за свои деньги", "2020-07-05T14:31:43.478198017Z", "прозрачный", "0", 7, 0, 4, "Органайзер для одежды", "Ronomo"], "210": ["Удобная вещь для  футболок, разу порядок в шкафу..НО.. сняла 2 звезды из-за того, что одна треснула, не сразу заметила.но все равно оставила.. удобная.. возможно на долго не хватит в общем видно будет", "2020-07-03T13:56:16.150761536Z", "прозрачный", "0", 4, 0, 3, "Органайзер для одежды", "Ronomo"], "211": ["Полный восторг. Очень довольна приобретением этих файлов! Раньше подкладывала разные плотные картонки в стопку с футболками. \r\nТеперь совсем другое дело - очень удобно. Можно легко достать вещь снизу и при этом порядок сохранится.\r\nДа, файлики тонкие, но для того, чтобы сложить по 1-2 футболки на лист, плотность достаточная. Не уверена, что эффект будет тот же для более тяжелых и плотных вещей, как свитера и кардиганы. Думаю, для них можно приобрести другие органайзеры.", "2020-07-03T10:04:01.932530331Z", "прозрачный", "0", 4, 0, 5, "Органайзер для одежды", "Ronomo"], "212": ["Отлично. Теперь порядок в шкафу", "2020-05-28T13:12:32.329197645Z", "прозрачный", "0", 7, 2, 5, "Органайзер для одежды", "Ronomo"], "214": ["Я  очень довольна покупкой. Такая нужная вещь оказывается. Заказала сразу еще!", "2020-06-25T17:25:17.953252173Z", "прозрачный", "0", 3, 0, 5, "Органайзер для одежды", "Ronomo"], "215": ["Не знаю, почему другие покупатели недовольны, я получила то что ожидала. Пластик достаточно гибкий, как и положено, потому что при выборе в стопке должно быть удобно «листать» уровни, с твёрдым пластиком ты этого не сделаешь. Для футболок и летних брюк идеально, для более объемных вещей я бы и не стала брать, потому что скорее всего эти разделители нацелены именно на необьемные вещи.", "2020-06-24T11:09:59.305975576Z", "прозрачный", "0", 12, 0, 5, "Органайзер для одежды", "Ronomo"], "216": ["Не советую ", "2020-06-23T10:52:41.551308869Z", "прозрачный", "0", 2, 7, 2, "Органайзер для одежды", "Ronomo"], "217": ["Редкая ерунда, очень тонкий пластик гнется в руках. Идея была хороша,но качество подкачало. Возврат", "2020-06-19T10:04:17.222569344Z", "прозрачный", "0", 4, 2, 5, "Органайзер для одежды", "Ronomo"], "218": ["Не совсем то, что я ожидала. Пластик, если его можно так назвать, очень тонкий, сколько прослужит неизвестно. Для футболок подходит, а вот для всего остального ( кофт,свитеров,штанов и т.д) нет.Считаю,что цена завышена, даже со скидкой.", "2020-06-17T12:49:41.171718884Z", "прозрачный", "0", 13, 0, 2, "Органайзер для одежды", "Ronomo"], "219": ["Заказывала две упаковки, в обоих не хватает по 1 листу. Каждый лист стоит 50 рублей, в итоге обман на 100 рублей. Проверяйте сразу.", "2020-05-27T17:31:23.240747742Z", "прозрачный", "0", 6, 1, 1, "Органайзер для одежды", "Ronomo"], "220": ["Пластик на самом тонкий, тем не менее форму держит идеально. Не уменьшает объём  шкафа! Работает отлично! Цена со скидкой вполне норм, полная стоимость-завышена ", "2020-05-25T13:00:28.929543124Z", "прозрачный", "0", 4, 0, 5, "Органайзер для одежды", "Ronomo"], "221": ["Очень тонкий пластик ", "2020-05-23T18:50:18.493520493Z", "прозрачный", "0", 3, 0, 3, "Органайзер для одежды", "Ronomo"], "222": ["Ужасная штука ,пластик похож на упаковку из под яиц . Или упаковочный материал . Категорически не рекомендую. Цена максимум 100 руб", "2020-05-23T17:03:04.506374328Z", "прозрачный", "0", 2, 1, 1, "Органайзер для одежды", "Ronomo"], "223": ["Пластик гибкий, футболки на полке занимают меньше места теперь. Удобная штука", "2020-05-13T12:11:16.451057237Z", "прозрачный", "0", 2, 0, 4, "Органайзер для одежды", "Ronomo"], "224": ["Удобно очень. Можно как для футболок, так же для брюк и джинсов. В шкафу все по \"струночке\" \nОчень довольна", "2020-04-27T08:59:45.583085678Z", "прозрачный", "0", 5, 0, 5, "Органайзер для одежды", "Ronomo"]}
